import React from 'react'

const CTA = () => {
    return (
        <div className='text-center max-w-max bg-black text-white text-base font-medium p-3 rounded px-5'>Buy STAGELINK</div>
    )
}

const Hero = () => {
    return (
        <div className='flex flex-col p-12 py-14 items-center'>
            <div className='text-center space-y-3 my-6'>
                <div className='font-bold text-4xl'>STAGELINK</div>
                <div className='font-medium text-xl'>Bridging sport tickets and cryptocurrency</div>
            </div>
            <div className='my-12'><CTA /></div>
        </div>
    )
}

const Home = () => {
    return (
        <div className='flex flex-col min-h-screen'>
            <div><Hero /></div>
        </div>
    )
}

export default Home
